import Foundation
import XCTest
@testable import MSFTInterviewQuestions


class ImplementStrStrTest: XCTestCase {
    func testSolver1() {
        let solver = ImplementStrStrSolution()
        XCTAssertEqual(solver.strStr("hello", "ll"), 2)
    }
    
    func testSolver2() {
        let solver = ImplementStrStrSolution()
        XCTAssertEqual(solver.strStr("aaaaa", "bba"), -1)
    }
    
    func testSolver3() {
        let solver = ImplementStrStrSolution()
        XCTAssertEqual(solver.strStr("", ""), 0)
    }
    
    func testSolver4() {
        let solver = ImplementStrStrSolution()
        XCTAssertEqual(solver.strStr("mississippi", "issipi"), -1)
    }
    
    func testSolver5() {
        let solver = ImplementStrStrSolution()
        let str1 = ""
        let str2 = ""

        XCTAssertEqual(solver.strStr(str1, str2), 39999)
    }
    
    
}


